func curlExample(keyID string) string {
	return `curl -X POST https://api.popsigner.com/v1/keys/` + keyID + `/sign \
  -H "Authorization: Bearer YOUR_API_KEY" \
  -H "Content-Type: application/json" \
  -d '{"data": "base64_encoded_message"}'`
}

